import React from 'react';
import './footer.css';

const Footer = () => {
  const year = new Date().getFullYear();

  return (
    <footer className="footer text-white py-5">
      <div className="container footer_container d-flex justify-content-between flex-wrap">
        {/* Branding */}
        <div className="footer_section mb-4">
          <h4 className="footer_title">Satyam Kumar</h4>
          <p className="mb-2">Â© {year} All rights reserved</p>
          <div className="social_icons d-flex">
            <a href="https://instagram.com" target="_blank" rel="noopener noreferrer">
              <i className="fa-brands fa-instagram me-3"></i>
            </a>
            <a href="https://facebook.com" target="_blank" rel="noopener noreferrer">
              <i className="fa-brands fa-facebook"></i>
            </a>
          </div>
        </div>

        {/* Contact Info */}
        <div className="footer_section mb-4">
          <h4 className="footer_title">Get In Touch</h4>
          <p className="mb-1">satyamraj151.rajgir@gmail.com</p>
          <p className="mb-1">+91 8340429200</p>
          <p>Lorem ipsum dolor sit amet, consectetur adipisicing elit.</p>
        </div>

        {/* Links */}
        <div className="footer_section mb-4">
          <h4 className="footer_title">About</h4>
          <p><a href="/resume.pdf" className="footer_link">Resume</a></p>
          <p><a href="/projects" className="footer_link">Projects</a></p>
          <p><a href="/contact" className="footer_link">Contact</a></p>
        </div>
      </div>
    </footer>
  );
};

export default Footer;
